!function(){const n=JSON.parse(cardsData),d=document.querySelector(".portfolio__cards");console.log(d),n.forEach((n=>{d.insertAdjacentHTML("beforeend",`\n            <div class="card" ${n.id}>\n                <a href="#!6">\n                    <div class="card__img-wrapper">\n                        <div class=" card__img">\n                            <img src="${n.img}" width="216" alt="">\n                        </div>\n                    </div>\n                    <div class="card__decs">\n                        <div class="card__header">\n                            <h3 class="title-3">${n.title}</h3>\n                        </div>\n                        <div class="card__text">\n                            <p class="text">${n.info}\n                            </p>\n                        </div>\n                        <div class="card__skils">\n                            ${n.skils}\n                        </div>\n                    </div>\n                </a>\n            </div> \n        `)}))}();